	/**
	 * To string.
	 *
	 * @param separator the separator
	 * @return the string
	 */
	public String toString(String separator) {
		StringBuilder builder = new StringBuilder();
		
		builder.append(StringUtils.leftPad(StringUtils.EMPTY + row, 10, separator)).append(separator)
		.append(dependencia)
		.append(separator)
		.append(finun)
		.append(separator)
		.append(partida)
		.append(separator)
		.append(StringUtils.rightPad(StringUtils.EMPTY + e1, 2, separator))
		.append(separator)
		.append(StringUtils.rightPad(StringUtils.EMPTY + e2, 2, separator))
		.append(separator)
		.append(StringUtils.rightPad(StringUtils.EMPTY + e3, 2, separator))
		.append(separator)
		.append(StringUtils.rightPad(StringUtils.EMPTY + e4, 2, separator))
		.append(separator)
		.append(StringUtils.rightPad(StringUtils.EMPTY + e5, 2, separator))
		.append(separator)
		.append(StringUtils.rightPad(StringUtils.EMPTY + e6, 2, separator))
		.append(separator)
		.append(StringUtils.rightPad(StringUtils.EMPTY + e7, 2, separator))
		.append(separator)
		.append(StringUtils.rightPad(StringUtils.EMPTY + e8, 2, separator))
		.append(separator)
		.append(StringUtils.leftPad(DecimalUtils.formatDouble(suma2), 18, separator))
		.append(separator)
		.append(StringUtils.leftPad(DecimalUtils.formatDouble(total2), 18, separator))
		.append(separator)
		.append(StringUtils.rightPad(StringUtils.EMPTY + e9, 2, separator))
		.append(separator)
		.append(StringUtils.rightPad(StringUtils.EMPTY + e10, 2, separator))
		.append(separator)
		.append(StringUtils.rightPad(StringUtils.EMPTY + e11, 2, separator))
		.append(separator)
		.append(StringUtils.rightPad(StringUtils.EMPTY + e12, 2, separator))
		.append(separator)
		.append(StringUtils.rightPad(StringUtils.EMPTY + e13, 2, separator))
		.append(separator)
		.append(StringUtils.rightPad(StringUtils.EMPTY + e14, 2, separator))
		.append(separator)
		.append(st2)
		;
		return builder.toString();
	}
	
